import React from 'react'
import PropTypes from 'prop-types'
import axios from 'axios'

function Card({ toLoad, values }) {
  if (toLoad === false) {
    ;<div>
      loading ...<h1></h1>
    </div>
  }
  const getLists = async (id) => {
    const boards = await axios.get(
      `https://api.trello.com/1/boards/${id}?key=4771cda06157329944b577f382bc2cf3&token=`
    )
  }
  return (
    <div>
      {values.map((ele) => {
        return (
          <div
            className="homepage-card"
            key={ele.id}
            onClick={() => {
              getLists(ele.id)
            }}
          >
            <h1>{ele.name}</h1>
          </div>
        )
      })}
    </div>
  )
}

Card.propTypes = {
  values: PropTypes.array.isRequired,
  toLoad: PropTypes.bool.isRequired
}
export default Card
